class ProjectPositionResponseModel {  List<ProjectPositionModel>? data;  ProjectPositionResponseModel({this.data});  ProjectPositionResponseModel.fromJson(List<dynamic>? json) {    if (json != null) {      data = <ProjectPositionModel>[];      json.forEach((v) {        data!.add(new ProjectPositionModel.fromJson(v));      });    }  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = new Map<String, dynamic>();    if (this.data != null) {      data['Data'] = this.data!.map((v) => v.toJson()).toList();    }    return data;  }}class ProjectPositionModel {  int? staffTitleId;  String? staffTitleName;  String? slug;  String? staffTitleDescription;  String? createdAt;  String? createdBy;  bool? isSelected;  ProjectPositionModel(      {this.staffTitleId,        this.staffTitleName,        this.slug,        this.staffTitleDescription,        this.createdAt,        this.createdBy, this.isSelected = false});  ProjectPositionModel.fromJson(Map<String, dynamic> json) {    staffTitleId = json['staff_title_id'];    staffTitleName = json['staff_title_name'];    slug = json['slug'];    staffTitleDescription = json['staff_title_description'];    createdAt = json['created_at'];    createdBy = json['created_by'];    this.isSelected = false;  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = new Map<String, dynamic>();    data['staff_title_id'] = this.staffTitleId;    data['staff_title_name'] = this.staffTitleName;    data['slug'] = this.slug;    data['staff_title_description'] = this.staffTitleDescription;    data['created_at'] = this.createdAt;    data['created_by'] = this.createdBy;    return data;  }}